VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'permanent if too many brain cells die after being starved of oxygen. These cells are never replaced. The good news is that sometimes brain cells don’t die during stroke — instead, the damage is temporary. Over time, as injured cells repair themselves, previously impaired function improves. In other cases, undamaged brain cells nearby may take over for the areas of the brain that were injured. Either way, strength may return, speech may get better and memory may improve. This recovery process is what stroke rehabilitation is all about. Learn more about stroke. Heart failure Heart failure, sometimes called congestive heart failure, means the heart isn’t pumping blood as well as it should. Heart failure does not mean that the heart stops beating — that’s a common misperception. Instead, the heart keeps working, but the body’s need for blood and oxygen isn’t being met. Heart failure can get worse if left untreated.', '{-0.7788489460945129,0.06558238714933395,0.922309398651123,-0.3273422420024872,0.21466191112995148,0.2482476681470871,0.18762783706188202,-0.0746038556098938,-1.257315754890442,-0.40067222714424133,0.5128707885742188,0.6893569827079773,-0.3403499126434326,0.3892150819301605,-0.4032600224018097,-0.33697089552879333,0.6212047338485718,0.18475019931793213,-0.44215986132621765,0.2339874655008316,-1.0143558979034424,0.20604662597179413,-0.47236236929893494,-0.43999040126800537,0.14345045387744904,0.10980533808469772,-0.388683557510376,-0.12389597296714783,0.00020424649119377136,0.583915650844574,-1.3940558433532715,0.690899670124054,-0.38808950781822205,0.818891704082489,-0.3372964859008789,-0.10700073093175888,-0.7733399271965027,0.10056981444358826,0.6655884385108948,-0.4259185791015625,0.031946297734975815,-0.7232268452644348,-0.40294837951660156,0.07473792880773544,-0.2577621638774872,-0.4944171905517578,-0.23007206618785858,-0.0871564969420433,0.18696390092372894,-0.07914164662361145,-