VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'the body’s need for blood and oxygen isn’t being met. Heart failure can get worse if left untreated. If your loved one has heart failure, it’s very important to follow their health care professional’s treatment plan. Learn more about heart failure. Arrhythmia Arrhythmia refers to an abnormal heart rhythm. There are various types of arrhythmias. The heart can beat too slow, too fast or irregularly. Bradycardia, or a heart rate that’s too slow, is when the heart rate is less than 60 beats per minute. Tachycardia, or a heart rate that’s too fast, refers to a heart rate of more than 100 beats per minute. An arrhythmia can affect how well your heart works. With an irregular heartbeat, your heart may not be able to pump enough blood to meet your body’s needs. Learn more about arrhythmia. Heart valve problems When heart valves don’t open enough to allow the blood to flow through as it should, a condition called stenosis results.', '{-0.4291091561317444,-0.24338097870349884,0.10392505675554276,-0.16644831001758575,0.0839327946305275,0.705252468585968,0.5065723061561584,0.21196411550045013,-0.5857626795768738,-0.8113885521888733,1.057270884513855,0.8704424500465393,-0.19959129393100739,-0.3966776132583618,-0.44243693351745605,-0.06513522565364838,0.4208175241947174,0.11638211458921432,0.05321371555328369,-0.13970594108104706,-0.5932891368865967,-0.25061124563217163,-0.7537952065467834,0.4437149465084076,0.6796292066574097,0.24571025371551514,-0.6082714796066284,-0.5689418911933899,-0.2366657555103302,0.1884208470582962,-1.0069819688796997,-0.2507281005382538,0.0403585359454155,0.8071038722991943,0.18597665429115295,-0.3603459298610687,-0.20170608162879944,0.39202725887298584,-0.06658487021923065,-0.4618310034275055,-0.12872260808944702,-0.49504274129867554,-0.5920237302780151,-0.45725566148757935,-0.0330374576151371,-0.03176163509488106,0.19006720185279846,0.11306412518024445,-0.20619642734527588,0.70918