VALUES ('HEART Guidelines: High Blood Pressure', 'High Blood Pressure Take Control of Your Blood Pressure, Try Our BP Calculator What Is High Blood Pressure? High blood pressure occurs when the force of blood flowing through your blood vessels is consistently too high. High blood pressure is also called hypertension. Get the facts Understanding Blood Pressure Readings Health Threats From High Blood Pressure How to Manage High Blood Pressure Blood Pressure Calculator Support That Empowers Managing high blood pressure or any chronic condition is more manageable when you have emotional support. Join our online community of other individuals who know what you are going through and can help you on your journey. Find encouragement Play without Auto-Play Play Video Video: Learn how to monitor your blood pressure at home Play without Auto-Play Play Video Video: What is the difference between hypertension and high blood pressure? Let''s Talk About Blood Pressure In this free learning tool, you can learn: The risks of high blood pressure How self-monitoring can help control high blood pressure Explore and download free information along the way. Hablemas sobre presión arterial', 'HEART_Association', 'high-blood-pressure', 'https://www.heart.org/en/health-topics/high-blood-pressure', 'professional_guideline', '{"content_hash": "2d24ec679a0c031c", "embedding_date": "2025-06-25T14:49:21.764405", "scraper_source": "HEART_Association", "category": "medical_associations", "subcategory": "heart_guidelines", "document_type": "professional_guideline", "published_date": "", "original_url": "https://www.heart.org/en/health-topics/high-blood-pressure"}', 1134);

