VALUES ('CANCER Guidelines: Breast Cancer.Html', 'Skip to main content × Help Our 24/7 cancer helpline provides information and answers for people dealing with cancer. We can connect you with trained cancer information specialists who will answer questions about a cancer diagnosis and provide guidance and a compassionate ear. Start Live Chat Live Chat available weekdays, 7:00 am - 6:30 pm CT Call us at 1-800-227-2345 Available any time of day or night Our highly trained specialists are available 24/7 via phone and on weekdays can assist through online chat. We connect patients, caregivers, and family members with essential services and resources at every step of their cancer journey. Ask us how you can get involved and support the fight against cancer. Some of the topics we can assist with include: Referrals to patient-related programs or resourcesDonations, website, or event-related assistanceTobacco-related topicsVolunteer opportunitiesCancer Information For medical questions, we encourage you to review our information with your doctor. Breast Cancer Whether you or a loved one are worried about developing breast cancer, have just been diagnosed, are going through breast cancer treatment, or are trying to stay well after treatment, this detailed information can help you find the answers you need. Get the most up-to-date facts about breast cancer, plus tools and resources for every step of your journey. (For information on breast cancer in men, see Breast Cancer in Men.) About Breast Cancer Breast Cancer Risk and Prevention Breast Cancer Early Detection and Diagnosis Understanding a Breast Cancer Diagnosis Breast Reconstruction Surgery Treating Breast Cancer Living as a Breast Cancer Survivor Non-cancerous Breast Conditions Quick Guides After a Breast Cancer Diagnosis If you’ve just been diagnosed with breast cancer, this short guide can help you know what to expect. Tools & Resources Breast Cancer Fact Sheet for Patients and Caregivers Get the facts about breast cancer, including risk factors, prevention, early detection, treatment, and more. Quiz: How Much Do You Know About Breast Cancer? When it comes to your breast health, don''t be fooled by rumors and misinformation. Test your knowledge of 6 common beliefs about breast cancer. Understanding Your Breast Pathology Report After a breast biopsy, your doctor will get a report that gives a diagnosis for each sample taken. Learn more about breast pathology reports here. Flyer: Breast Density and Your Mammogram Report Learn what it means if your mammogram report says you have dense breasts. Breast Cancer Videos Watch videos about breast cancer screening, genetic testing, potential side effects of treatment, and personal stories from breast cancer survivors. Infographic: 7 Tips for Getting a Mammogram Learn what you need to know about this test for finding breast cancer early. Cancer Care Toolkit Organize your cancer journey with the American Cancer Society Cancer Care Toolkit. Caregiver Resource Guide A helpful tool for people who are caring for someone with cancer. View the complete guide here. This information is possible thanks to people like you. We depend on donations to keep our cancer information available for the people who need it most. Donate Today More Resources Making Strides Against Breast Cancer Shop Hair Loss and Post-surgical Products News & Stories Breast Cancer News Stories of Hope Breast Cancer Research Highlights Help us end cancer as we know it, for everyone. Donate with Confidence', 'CANCER_Association', 'breast-cancer.html', 'https://www.cancer.org/cancer/breast-cancer.html', 'professional_guideline', '{"content_hash": "f9eabb29a64e902f", "embedding_date": "2025-06-25T14:49:21.849218", "scraper_source": "CANCER_Association", "category": "medical_associations", "subcategory": "cancer_guidelines", "document_type": "professional_guideline", "published_date": "", "original_url": "https://www.cancer.org/cancer/breast-cancer.html"}', 3463);

