VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'e, high blood glucose harms your body and can lead to diabetes-related complications if not treated.Most of the time, type 1 diabetes is diagnosed in young people, but it can develop in anyone at any age. Scientists and researchers today aren’t sure how to prevent type 1 diabetes or what triggers it.If you have type 1 diabetes, you can live a long, healthy life by having a strong support system and managing it with your diabetes care team. The treatment plan you develop with your diabetes care team will include insulin, physical activity, and an eating plan to reach your health goals.Type 1 Diabetes SymptomsIf you or your child have the following symptoms of diabetes, let your health care provider know.', '{0.2565142512321472,-0.8361774682998657,-0.005195902660489082,0.007603617385029793,-0.11393788456916809,0.5049235820770264,0.330317884683609,0.7035414576530457,0.5207099318504333,-0.01090453751385212,0.5082402229309082,0.5839110016822815,-0.4667348861694336,-0.5595250725746155,-0.8193787932395935,-0.15121692419052124,0.5692760348320007,0.5376538038253784,0.07626782357692719,-0.1414419412612915,-0.15839031338691711,-0.436882346868515,-0.2703566253185272,-0.1563301682472229,-0.04273214936256409,0.15593905746936798,-0.6385443210601807,-0.4365290403366089,0.2623540759086609,0.3721233606338501,-0.591748058795929,0.1752508282661438,0.5123040080070496,0.9854537844657898,-0.34500887989997864,-0.19958046078681946,-0.21093183755874634,0.8597936630249023,0.15768766403198242,-0.7821805477142334,0.3350270986557007,0.6506184339523315,-0.33722731471061707,0.07670466601848602,-0.6762459874153137,0.43710702657699585,0.5006003379821777,0.15420633554458618,0.505924642086029,0.2819421589374542,-0.285963237285614,-0.5554099082946777,0.06969009339809418,0.11345653980970383,0.0037922917399555445,0.2590528130531311,-0.6339042782783508,0.11453810334205627,-0.44353416562080383,-0.398227721452713,0.7686686515808105,0.16