VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'omsIf you or your child have the following symptoms of diabetes, let your health care provider know. Symptoms include:Urinating oftenFeeling very thirstyFeeling very hungry—even though you are eatingExtreme fatigueBlurry visionCuts/bruises that are slow to healWeight loss—even though you are eating moreIt’s important to know when you first develop type 1 diabetes, you may not have any symptoms at all. Choose an option Children with Type 1 Diabetes Adults with Type 1 Diabetes Learning Your Risk for Type 1 Diabetes Why Learning Your Risk Helps Image Children with type 1 diabetes will usually have the symptoms listed above. If your child is potty-trained without issues at night starts having accidents and wetting the bed again, diabetes might be the reason.Even though it’s easy to diagnose a child with diabetes by checking their blood glucose at the doctor’s office or emergency room, the tricky part is recognizing the symptoms and knowing to take your child to get checked.', '{0.06435175240039825,-0.7542896270751953,-0.047905340790748596,-0.39500656723976135,-0.25644373893737793,0.5967687368392944,-0.18472249805927277,0.5984532237052917,0.42323368787765503,0.2815364897251129,0.7091942429542542,0.8915446400642395,-0.45568111538887024,-0.6183170676231384,-1.2382160425186157,-0.04231299087405205,0.10477130860090256,0.5527437925338745,-0.18186943233013153,-0.23584578931331635,-0.009120254777371883,-0.8832459449768066,-0.23630866408348083,0.08743725717067719,-0.03269146382808685,0.05597134679555893,-0.5356885194778442,-0.7024927735328674,0.32948464155197144,0.44243744015693665,-0.5984241366386414,-0.10711319744586945,0.4802175462245941,0.7460591793060303,-0.07541050016880035,-0.02923048473894596,-0.070667564868927,0.9348589777946472,0.3754381835460663,-0.7357057332992554,0.16747072339057922,0.15180915594100952,-0.06594628095626831,-0.4742504954338074,-1.190373420715332,0.5503053665161133,0.4102911353111