VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'ncy room, the tricky part is recognizing the symptoms and knowing to take your child to get checked. If you’re a parent, it’s important to know that young children, including infants, can develop type 1 diabetes.Sometimes children can be in diabetic ketoacidosis (DKA) when they are diagnosed with diabetes. When there is a lack of insulin in the body, high levels of an acid called ketones can build up. DKA is a medical emergency that usually requires hospitalization and immediate care with insulin and IV fluids. Image When an adult develops type 1 diabetes, they are often mistakenly told they have type 2 diabetes. This may be from lack of awareness that type 1 diabetes can start at any age and in people of every race, shape, weight, and size. People with type 1 diabetes who also have the classic risk factors for type 2 diabetes—such as overweight/obesity, not being physically active, having high blood pressure, or are over age 35—are often misdiagnosed.', '{0.060139790177345276,-0.9253876209259033,-0.09620852023363113,-0.030727436766028404,-0.1664305031299591,0.45266613364219666,0.14197584986686707,0.657539963722229,0.589957594871521,0.11613567173480988,0.8209944367408752,1.0060086250305176,-0.4491477608680725,-0.25343865156173706,-0.9913367629051208,-0.2779027223587036,0.3393459916114807,0.9283589124679565,-0.14281012117862701,-0.3010016083717346,-0.059570714831352234,-0.4390120804309845,-0.20065619051456451,0.07379639148712158,-0.023846138268709183,0.29608848690986633,-0.6349589824676514,-0.5290495157241821,-0.0169653482735157,0.17051942646503448,-0.8106142282485962,-0.025669733062386513,0.6616442799568176,0.6973106861114502,-0.21085728704929352,-0.10413361340761185,-0.2785019278526306,0.8155476450920105,0.45523327589035034,-0.5771525502204895,0.1090070903301239,0.3599197566509247,0.08669953793287277,0.024066779762506485,-0.6524659395217896,0.6355879902839661,0.5374497175216675,0.44732812047004