VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'not being physically active, having high blood pressure, or are over age 35—are often misdiagnosed. It can also be tricky because some adults with new-onset type 1 diabetes are not sick at first. Their health care provider may find an elevated blood glucose level at a routine visit and starts them on diet, exercise, and an oral medication.Early detection and treatment of diabetes can decrease the risk of developing complications both at the time of diagnosis and in the future. By knowing and recognizing the symptoms above, you can learn if you have type 1 diabetes early and avoid complications, like diabetic ketoacidosis (DKA). Image Did you know?Type 1 diabetes doesn’t develop only in childrenThere have been recent advances in type 1 diabetes screening and treatmentIf you have a family history of type 1 diabetes, your health care provider may suggest screening for type 1 diabetes. They will order a blood test to measure your islet autoantibodies.', '{0.01362417172640562,-0.9594154357910156,-0.09870856255292892,-0.14160700142383575,-0.21553091704845428,0.5693152546882629,0.3848515450954437,0.7090831398963928,0.8480399250984192,0.17460638284683228,0.43910953402519226,0.9297764897346497,-0.17847149074077606,-0.622920572757721,-0.8454594612121582,-0.21176058053970337,0.4590317904949188,0.5011410117149353,-0.16738314926624298,-0.18819862604141235,0.2357974499464035,-0.5520521402359009,-0.20310449600219727,-0.06811044365167618,-0.1931360960006714,0.12735234200954437,-0.4743984043598175,-0.5686072707176208,0.08274712413549423,0.21054260432720184,-0.5568071007728577,0.011213083751499653,0.4745071828365326,0.4584104120731354,-0.4083978831768036,0.04121090844273567,-0.24303250014781952,0.9267531037330627,0.5158576965332031,-0.7636486887931824,0.1019686684012413,0.6474394798278809,0.018190691247582436,-0.16921217739582062,-0.4238443374633789,0.7625020146369934,0.6371535658836365,0.3641688823699951,0.43173