VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'st screening for type 1 diabetes. They will order a blood test to measure your islet autoantibodies. The test results can go one of two ways:Negative: Your health care provider will retest you in the future.Positive: Even if you get a positive result, this doesn’t mean you have type 1 diabetes. Your health care provider will refer you to counseling about the risk of developing diabetes, diabetes symptoms, and DKA prevention. Additional testing as needed may be done to determine the course of your treatment. Image Even if you may not want to know if you, your children, or other family members are at risk for developing type 1 diabetes, there are benefits to knowing.First, you can learn more about the early warning signs of type 1 diabetes so you and your health care team can detect diabetes early—before DKA or severe illness develops.', '{-0.25720706582069397,-0.9441316723823547,-0.0794457420706749,-0.30741268396377563,-0.3294963836669922,0.6337860226631165,0.26339593529701233,0.5662766098976135,0.7477083802223206,0.23644877970218658,0.03576838597655296,0.6333836317062378,-0.21790428459644318,-0.597133457660675,-0.7503122091293335,-0.2829492688179016,-0.03049466758966446,0.255623996257782,-0.25040724873542786,-0.26976409554481506,0.5064050555229187,-0.7488073706626892,-0.23993819952011108,-0.10841317474842072,-0.08141519874334335,0.17284999787807465,-0.18723008036613464,-0.7412555813789368,0.21315161883831024,0.28973516821861267,-0.4853353202342987,0.04498672857880592,0.47100958228111267,0.3788190484046936,-0.31997036933898926,0.047476306557655334,-0.4528845548629761,0.7922820448875427,0.5775437355041504,-0.9320715665817261,0.26599544286727905,0.6374256014823914,0.11404526978731155,-0.21625880897045135,-0.41514843702316284,0.8168089985847473,0.6286830306053162,0.35878071188926697,0.6201121211051941,0.48145413398742676,-0.9895633459091187,-0.4300341010093689,0.30493268370628357,0.10174752026796341