VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'up to a year. It’s important to know that the absence of symptoms doesn''t mean the diabetes is gone. The pancreas will eventually be unable to make enough insulin, and, if untreated, the symptoms will return.Is it Possible You Don''t Have Type 2 DiabetesIf you or someone you know is diagnosed with type 2 diabetes but isn’t able to manage it with the typical treatments for type 2 diabetes, it may be worth a visit to an endocrinologist to verify what type of diabetes you have. Generally, this requires antibody tests and possibly the measurement of a C-peptide level. It is important to be sure that your diagnosis is correct because that will determine your treatment plan, allowing you manage your diabetes and prevent its complications. Screening Acceleration Summit Type 1 Diabetes Dr. Fran Cogen Screening Acceleration Summit Type 1 Diabetes Dr. Nuha El Sayed Resources for Type 1 Diabetes Browse these resources for type 1 diabetes.', '{-0.3831924796104431,-1.0902600288391113,-0.08223264664411545,0.17897391319274902,-0.5476915240287781,0.6128859519958496,0.32962310314178467,0.7763631343841553,0.48296070098876953,0.3135973811149597,0.31520214676856995,0.5376503467559814,-0.39800241589546204,-0.512402355670929,-0.9403899312019348,-0.2090708464384079,0.37880077958106995,0.2879685163497925,-0.10228154063224792,-0.07732420414686203,0.35680097341537476,-0.7993248701095581,-0.1662445217370987,-0.3065940737724304,-0.2432122677564621,0.08533839881420135,-0.4258776605129242,-0.4227107763290405,0.11507593095302582,0.4094032347202301,-0.6039049029350281,-0.15152688324451447,0.33351612091064453,0.1658201962709427,-0.36738499999046326,-0.057713378220796585,-0.0044364952482283115,0.9735088348388672,0.4352116882801056,-0.6467478275299072,0.10170217603445053,1.2272897958755493,-0.04335332661867142,-0.30555686354637146,-0.5111479163169861,0.646828293800354,0.5242712497711182,0.033894941210746765,0.3836383819580078,0.