VALUES ('DIABETES Guidelines: Type 2', 'About Diabetes Understanding Type 2 Diabetes What is Type 2 Diabetes?In type 2 diabetes, your body does not use insulin properly—this is called insulin resistance. At first, your beta cells make extra insulin to make up for it. Over time, your pancreas can’t make enough insulin to keep your blood glucose at normal levels. Type 2 diabetes develops most often in middle-aged and older adults but is increasing in young people.Treatment for people with type 2 diabetes will include healthy eating and exercise. However, your health care provider may need to also prescribe oral and injectable medications (including insulin) to help you meet your target blood glucose levels.Symptoms of Type 2 DiabetesThe following symptoms of diabetes are typical. However, some people with type 2 diabetes have symptoms so mild that they go unnoticed.Common symptoms of diabetes:Urinating oftenFeeling very thirstyFeeling very hungry—even though you are eatingExtreme fatigueBlurry visionCuts/bruises that are slow to healTingling, pain, or numbness in the hands/feet Early detection and treatment of diabetes can decrease the risk of developing the complications of diabetes.Although there are many similarities between type 1 and type 2 diabetes, the cause of each is very different. And the treatment is usually quite different, too. Some people, especially adults who are newly diagnosed with type 1 diabetes, may have symptoms similar to type 2 diabetes and this overlap between types can be confusing. Take our Risk Test to find out if you are at increased risk for having type 2 diabetes.Maybe it’s a different typeIf you or someone you know is diagnosed with type 2 diabetes but isn’t responding well to the typical treatments for type 2 diabetes, it may be worth a visit to an endocrinologist to determine what type of diabetes is happening. Generally, this requires antibody tests and possibly the measurement of a C-peptide level.Gestational diabetesWomen with gestational diabetes often have no symptoms, which is why it''s important for at-risk women to be tested at the proper time during pregnancy.Learn more about Gestational DiabetesSymptoms of diabetes complicationsHave you already been diagnosed with diabetes but are concerned about symptoms that may be the result of complications related to diabetes?Learn more about diabetes complications Give Today and Change lives! With your support, the American Diabetes Association® can continue our lifesaving work to make breakthroughs in research and provide people with the resources they need to fight diabetes. Give Today', 'DIABETES_Association', 'type-2', 'https://diabetes.org/diabetes/type-2', 'professional_guideline', '{"content_hash": "8748347ba2df4431", "embedding_date": "2025-06-25T14:49:22.386255", "scraper_source": "DIABETES_Association", "category": "medical_associations", "subcategory": "diabetes_guidelines", "document_type": "professional_guideline", "published_date": "", "original_url": "https://diabetes.org/diabetes/type-2"}', 2574);

