VALUES ('LUNG Guidelines: Copd', 'Chronic Obstructive Pulmonary Disease (COPD) Can we help you find more info? Start by selecting which best describes you. Select your persona I am... interested in learning about COPD newly diagnosed living with COPD a caregiver an educator/health professional Facebook Twitter LinkedIn Email Print Chronic obstructive pulmonary disease (COPD), which includes chronic bronchitis and emphysema, is a long-term lung disease that makes it hard to breathe. The good news is COPD is often preventable and treatable.  Here you''ll find information, resources and tools to help you understand COPD, manage treatment and lifestyle changes, find support and take action. What you need to know about COPD Find out how COPD affects the airways, what causes it and different types of COPD. What to do after a COPD diagnosis Learn important treatment information such as how to use your COPD medicines and develop a COPD action plan. How to manage COPD in daily life Understand how to prevent COPD flare ups/exacerbations and manage your daily activities to maintain a good quality of life. Early Warning Signs of COPD Don''t delay talking to your healthcare provider about respiratory symptoms—early detection may improve your quality of life. Lung Health Navigators Our Lung Health Navigators empower people to understand and manage their lung health. We offer FREE one-on-one education programs to support those living with lung disease including COPD. Connect with a Navigator Important COPD Resources COPD Action PlanBetter Breathers ClubsLiving with COPD Online Support Community COPD Programs and Initiatives COPD BasicsCOPD Educator CourseCOPD for Life Education Series Learn About COPD The more you understand about COPD the better you and your loved ones can manage living with this disease. Read More Causes & Risk Factors Over time, exposure to irritants that damage your lungs and airways can cause COPD, which includes chronic bronchitis and emphysema. The main cause of COPD is smoking, but nonsmokers can get COPD too. Read More Symptoms & Diagnosis To diagnose chronic obstructive pulmonary disease (COPD), which includes chronic bronchitis and emphysema, your doctor will evaluate your symptoms, ask for your complete health history, conduct a health exam and examine test results. Read More Newly Diagnosed If you have been newly diagnosed with COPD, emphysema, or chronic bronchitis follow these steps to better understand and manage your diagnosis. Read More Treatment Your treatment plan will help you control your symptoms and know what to do when your COPD gets worse. Read More Living with COPD With COPD, there are lifestyle changes that can help you stay more active and improve your quality of life. Read More Finding Support An important part of living with COPD is finding the right support, both for you and your caregivers. Read More COPD Resource Library This library includes videos and other resources for COPD patients and caregivers. Read More Health Professionals & Educators If you are a healthcare professional treating COPD patients, it is important to stay informed about COPD care, resources and support options. Read More Talk to an expert Our Lung HelpLine is staffed by registered nurses and respiratory therapists ready to help answer your questions about COPD. Connect with us by phone, email or live chat. Contact HelpLine Show We Can’t Do This Alone Help fund lifesaving lung health research. Through June 30, gifts are 3X-MATCHED for TRIPLE the impact. Donate Today! Show', 'LUNG_Association', 'copd', 'https://www.lung.org/lung-health-diseases/lung-disease-lookup/copd', 'professional_guideline', '{"content_hash": "e78f5bc70e496a49", "embedding_date": "2025-06-25T14:49:22.531713", "scraper_source": "LUNG_Association", "category": "medical_associations", "subcategory": "lung_guidelines", "document_type": "professional_guideline", "published_date": "", "original_url": "https://www.lung.org/lung-health-diseases/lung-disease-lookup/copd"}', 3507);

