VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 're you understand about COPD the better you and your loved ones can manage living with this disease. Read More Causes & Risk Factors Over time, exposure to irritants that damage your lungs and airways can cause COPD, which includes chronic bronchitis and emphysema. The main cause of COPD is smoking, but nonsmokers can get COPD too. Read More Symptoms & Diagnosis To diagnose chronic obstructive pulmonary disease (COPD), which includes chronic bronchitis and emphysema, your doctor will evaluate your symptoms, ask for your complete health history, conduct a health exam and examine test results. Read More Newly Diagnosed If you have been newly diagnosed with COPD, emphysema, or chronic bronchitis follow these steps to better understand and manage your diagnosis. Read More Treatment Your treatment plan will help you control your symptoms and know what to do when your COPD gets worse.', '{0.4279114305973053,-1.0686299800872803,0.5927251577377319,-0.41180816292762756,0.3402346074581146,1.119649052619934,0.3660484552383423,-0.22663310170173645,-0.0723615437746048,-0.5457218289375305,-0.015698203817009926,0.06485522538423538,0.14391686022281647,-0.3274576961994171,-0.47680404782295227,0.06274912506341934,0.27934738993644714,-0.11560964584350586,0.6202558875083923,-0.08796514570713043,-0.7641816139221191,-0.503612756729126,-0.6077942848205566,-0.6086957454681396,-0.764696478843689,0.4620361924171448,-1.0015876293182373,-0.001888048485852778,0.0796961560845375,0.2850543260574341,-0.6765666604042053,0.6639093160629272,-0.38790053129196167,0.4088760018348694,-0.3969559967517853,-0.1522524058818817,-0.05095231160521507,0.6941593289375305,-0.6267315745353699,-0.10299871861934662,0.39008280634880066,1.451743721961975,-0.2393869161605835,0.1181780993938446,-0.18024364113807678,0.5511439442634583,0.3119674324989319,-0.08695057034492493,0.04030170291662216,0.28696709871292114,-0.35662296414375305,0.175767466425895