VALUES ('LUNG Guidelines: Asthma', 'Asthma Can we help you find more info? Start by selecting which best describes you. Select your persona I am... interested in learning about asthma newly diagnosed living with asthma a parent/caregiver an educator/health professional Facebook Twitter LinkedIn Email Print Asthma makes breathing difficult for millions of Americans. There is no cure, but it can be managed and treated so you can live a normal, healthy life. What you need to know about asthma Find out how asthma affects the airways, what causes it and different types of asthma. What to do after an asthma diagnosis Learn important treatment information such as how to use your asthma medicines and develop an asthma action plan. How to manage and control asthma Get tools to help monitor symptoms and understand if asthma is well-controlled, tips to recognize and reduce triggers. Lung Health Navigators Our Lung Health Navigators empower people to understand and manage their lung health. We offer FREE one-on-one education programs to support those living with lung disease including asthma. Important Asthma Resources Asthma BasicsAsthma Action Plan Living with Asthma Online Support Community Patient & Caregiver Network Asthma Programs and Initiatives Asthma-Friendly Schools InitiativeBreathe Well, Live WellKickin’ AsthmaOpen Airways for Schools Learn About Asthma The more you understand about asthma, the better you and your loved ones can manage living with this disease. Read More Symptoms & Diagnosis Is it asthma? Learn about common asthma symptoms and when you should see a healthcare provider. Read More Treatment Medicines can help control asthma, and regular healthcare and an action plan are important parts of your treatment. Read More Managing Asthma Get tips and tools to keep your asthma managed and in control throughout your life. Read More Finding Support Getting help when you need it is important. Explore these resources to help you connect with the support you need. Read More Asthma Resource Library Videos, toolkits, worksheets, infographics and other resources for asthma patients and caregivers. Read more Health Professionals & Educators Stay informed about asthma care, initiatives and educational opportunities. Read More May is Asthma Awareness Month See what new learning opportunities are available. Learn More Show We Can’t Do This Alone Help fund lifesaving lung health research. Through June 30, gifts are 3X-MATCHED for TRIPLE the impact. Donate Today! Show', 'LUNG_Association', 'asthma', 'https://www.lung.org/lung-health-diseases/lung-disease-lookup/asthma', 'professional_guideline', '{"content_hash": "c7ccbc311fb6603c", "embedding_date": "2025-06-25T14:49:22.652048", "scraper_source": "LUNG_Association", "category": "medical_associations", "subcategory": "lung_guidelines", "document_type": "professional_guideline", "published_date": "", "original_url": "https://www.lung.org/lung-health-diseases/lung-disease-lookup/asthma"}', 2468);

